import { BrowserRouter, Route } from "react-router-dom";
import Hero from "./pages/HeroPage";

function Routes() {
  return (
    <BrowserRouter>
      <Route path="/">
        <Hero />
      </Route>
    </BrowserRouter>
  );
}

export default Routes;
